import React from "react";

const Navigation = () => {
  return (
    <nav className="border-2 w-dvw flex-initial justify-items-end">
      <p className="cursor-pointer text-base font-semibold underline ">
        Log out
      </p>
    </nav>
  );
};

export default Navigation;
